/** @format */

import React from 'react';
import ReactDom from 'react-dom';
import './styles.css';

function sum(a, b) {
	return a + b;
}

function primeiroJSX() {
	/* prettier-ignore */
	return (
    <div>
        Introdução ao React - DIO
		<p>Soma: {sum(10, 13)}</p>
    </div>
    )
}

const elemento = <h2>Renderização</h2>;

const App = () => {
	/* prettier-ignore */

	return (
	<div className="App">
		{primeiroJSX()}
		
		</div>
	)
};

const rootElement = document.getElementById('root');
ReactDom.render(<App />, rootElement);
